ggT a b = if b == 0 then a else ggT b (mod a b)

ggT' a b = case b of 
			0 -> a
			_ -> ggT' b (mod a b)

ggT'' a 0 = a
ggT'' a b = ggT'' b (mod a b)

ggT''' a b  | b == 0 	= a
			| otherwise = ggT''' b (mod a b) 

outer' a b =
  let inner c = a + b + c
  in inner 1

