primes :: [Integer]-> Int -> [Integer]
primes _      0 = []
primes (p:xs) i = (:) p $primes [x|x<- xs, mod x p > 0] $i + 1

primes2 :: [(Integer, Int)]-> Int -> Int -> [(Integer, Int)]
primes2 ((p,_):xs) max i	| i < max =  (:) (p, i + 1) $primes2 [x|x <- xs, mod (fst x) p > 0] max $i + 1
							| otherwise = []

