finde :: [Char] -> Char -> Bool 
finde [] _ = False
finde (x:xs) y  | x == y = True
				| otherwise = finde xs y

findeAbc :: [Char] -> [Char] -> [(Char, Bool)] 
findeAbc []			_		= []
findeAbc (x:xs)		w 		= (x, finde w x) : findeAbc xs w